import React from 'react'
// import { link } from 'fs';
//import './Person.css'
const test= (arg)=> {
    // console.log(arg.nested)
    var obj = Object.keys(arg.nested)
    obj.forEach((val,j)=>{
        return (
        <li key={j}>key : {val} and value is : {arg.nested[val]}</li>
        )
    })

};

export default test;
